@Override
public void deleteFiles(Collection<String> names) throws IOException {
  ensureOpen();
  for(String name : names) {
    RAMFile file = fileMap.remove(name);
    if (file != null) {
      file.directory = null;
      sizeInBytes.addAndGet(-file.sizeInBytes);
    } else {
      throw new FileNotFoundException(name);
    }
  }
}

